class NBC_categorical:
  def NBC_fit(self, Xtrain, Ytrain):
        self._Xtrain = Xtrain
        self._Ytrain = Ytrain
        self._uniqueclasses = np.unique(Ytrain)
        self._priorsvalues = np.zeros(len(self._uniqueclasses), dtype = np.float64)
        for i, ci in enumerate(self._uniqueclasses):
            Xi = Xtrain[Ytrain == ci]
            self._priorsvalues[i] = Xi.shape[0] / float(Xtrain.shape[0])

  def _class_Probability_matrix(self, class_no):
    X = self._Xtrain[self._Ytrain == class_no]
    X = np.transpose(X)
    length = X.shape[0]
    width = X.shape[1]
    class_matrix = np.zeros((length, 256))
    for pixel in range(length):
      array = X[pixel]
      freq_array = np.zeros(256)
      for value in array:
        freq_array[value] += 1
      class_matrix[pixel] = (freq_array/len(array))
    return class_matrix

  def _all_classes_matrices(self):
    self._classes_matrices = np.zeros((len(self._uniqueclasses), 784, 256))
    for i, ci in enumerate(self._uniqueclasses):
      class_matrix = self._class_Probability_matrix(ci)
      self._classes_matrices[i] = class_matrix

  def _MAP(self, x):
    log_probabilities = np.zeros(len(self._uniqueclasses))
    for idx, ci in enumerate(self._uniqueclasses):
      matrix = self._classes_matrices[idx]
      sum = 0.0
      prob_vector = []
      for i in range(len(x)):
        value = x[i]
        prob = matrix[i][value]
        prob_vector.append(prob)
      sum = np.sum(np.nan_to_num(np.log(prob_vector)))
      log_probabilities[idx] = sum #+ log(self._priorsvalues[idx])
    classified_class = np.argmax(log_probabilities)
    return self._uniqueclasses[classified_class]

  def predict(self, Xtest):
    self._all_classes_matrices()
    y_predicted = [self._MAP(x) for x in Xtest]
    return np.array(y_predicted)

obj = NBC_categorical()
obj.NBC_fit(Xtrain, ytrain)
y_predicted = obj.predict(Xtest)

print(f'Categorical Model Accuracy is {round(Accuracy(y_predicted, ytest))}%')

